// import { faExclamationCircle } from "@fortawesome/free-solid-svg-icons";
import { Component } from "react"
import Title from '../component/funcComponents/Title';
import ClassInputBox from '../component/classComponents/ClassInputBox/ClassInputBox';
import ClassButton from '../component/classComponents/ClassButton/ClassButton';
import utilities from '../utilities/utilities';

// TODO // 
//✅ Nome // Cognome 

// Genere // Data di nascita

// Email

// Password
// Conferma Password

// Button Conferma

export default class Registration extends Component {
    // constructor(props){
    //     super(props)
    // }

    handleName = (e) => {
        this.name = e
    }

    handleSurname = (e) => {
        this.name = e
    }

    handleSubmit() {
        if (utilities.checkEmailValidity(this.name)) {
            console.log("zoppu fuaitti")
        }

    }

    render() {
        return (
            <>
                <Title title={"Registration"} subtitle={"Don't have an account?"} />
                <div className="mainForm">
                    <div className="Container-form">

                        <div className="personal">
                            <ClassInputBox
                                placeholder={'Name'}
                                name={'Name'}
                                type={'text'}
                                callbackInput={this.handleName}
                                maxlength={24}
                                cssName={'text'}
                            />
                            <ClassInputBox
                                placeholder={'Surname'}
                                name={'Surname'}
                                type={'text'}
                                callbackInput={this.handleSurname}
                                maxlength={24}
                                cssName={'text'}
                            />
                        </div>

                        <div className="personal">
                            <ClassInputBox
                                placeholder={'Name'}
                                name={'Name'}
                                type={'text'}
                                callbackInput={this.handleName}
                                maxlength={24}
                                cssName={'text'}
                            />
                            <ClassInputBox
                                placeholder={'Surname'}
                                name={'Surname'}
                                type={'text'}
                                callbackInput={this.handlePersonal}
                                maxlength={24}
                                cssName={'text'}
                            />
                        </div>

                        <ClassButton
                            label={'SIGN UP'}
                            cssName={'Sign-in'}
                            callbackButton={this.handleSubmit}
                        />
                    </div>

                    <div className='Check' >
                        <span>
                            <input type='checkbox' id='RememberMe' />
                            <label htmlFor='RememberMe'>Remember Me</label>
                        </span>

                        <ClassButton
                            label={'Forgot Password'}
                            cssName={'forgot-password'}
                        />
                        {/* </div> */}
                    </div>

                    {/* <div className='signWith'>
                        <Link to="/registration" style={{ color: 'white', textDecoration: 'none' }}>Registration</Link>
                    </div> */}

                    <div className='signWith'>
                        <span>— Or Sign In With —</span>
                    </div>

                    <div className="socialButtons">
                        <ClassButton
                            label={'Facebook'}
                            cssName={'buttonSocial'}
                        />
                        <ClassButton
                            label={'Twitter'}
                            cssName={'buttonSocial'}
                        />
                    </div>
                </div>
            </>
        )
    }
}
